import React from "react";
import HomeJobsCard from "../HomePage/HomeJobsCard";
import HomeWebinarsCard from "../HomePage/HomeWebinarsCard";

const Contact = ()=>{
    return(
        <>
        <div  id="contact-section">
            <h1>Welcome Contact</h1>
            <HomeJobsCard/>
        </div>
        </>
    ); 
};

export default Contact;
